import React from 'react';
import { Chart } from 'chart.js';

const Bar2 = new Chart(ctx, {
  type: 'bar',
  data: {
      datasets: [{
          label: 'Bar Dataset',
          data: [10, 20, 30, 40],
          // this dataset is drawn below
          order: 2
      }, {
          label: 'Line Dataset',
          data: [10, 10, 10, 10],
          type: 'line',
          // this dataset is drawn on top
          order: 1
      }],
      labels: ['January', 'February', 'March', 'April']
  },
  options: {
    type: 'scatter',
    data: data,
    options: {
      scales: {
        y: {
          beginAtZero: true
        }
      }
    }
  }
});

export default Bar2;
